import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the view toggle buttons appear, we first need to perform a search.
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('button.search-btn');

    // Wait for the search results and view toggle buttons to be visible
    await page.waitForSelector('.view-toggle', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results_grid_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results_grid_view.png'));

    // Find and click the "List View" button
    const listViewButton = await page.locator('button[title="List View"]');
    await listViewButton.click();

    // Wait for the product list container to appear, indicating the view has changed
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view_active.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view_active.png'));

    // Extract data to verify the task
    const isListViewVisible = await page.locator('.products-list').isVisible();
    const listViewButtonClass = await listViewButton.getAttribute('class');
    const hasActiveClass = listViewButtonClass.includes('active');

    return {
      success: true,
      action: "Switched to List View Mode after performing a search.",
      extractedData: {
        isListViewVisible: isListViewVisible,
        isListViewButtonActive: hasActiveClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
